import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./parks.json";
import "./ParkComponent.css";

class ParkComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ParkName: "",
      ParkDescription: "",
      ParkMainImage: "",
      AddressLine1: "",
      AddressLine2: "",
      AddressLine3: "",
      City: "",
      stateCode: "",
      postalCode: "",
      Directions: "",
      ParkImages: [],
      parkCode: this.props.match.params.parkCode
    };
  }
  componentDidMount() {
    {
      fetch(
        "https://developer.nps.gov/api/v1/api_key=y010UOulh2F9R7ahrlYpcyXUEJltY7vRei1uVxpe"
      )
        .then(res => res.json)
        .then(res => {
          this.setState({
            park: res.data[0]
          });
        });
    }
  }
  render() {
    let AllParks = Parks.map(park => {
      return (
        <div className="parkcomponent-container">
          <Link to={`park/${park.parkCode}`}>
            <p className="ParkName">{park.name}</p>
            <div className="ImageContainer">
              <div className="fade" />
              <img className="Image" src={park.images[0].url} />
            </div>
          </Link>
        </div>
      );
    });
    return <div className="grid">{AllParks}</div>;
  }
}
export default ParkComponent;
